import React from 'react'

const NotFound = () => {
    return(
        <div className="container">
            <h2 className="display-2 font-weight-bold pt-4 text-center">404</h2>
            <h1 className="display-1 font-weight-bold py-5 text-center">
                Page Not Found
            </h1>
        </div>
    )
}
export default NotFound
